/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<div class="${classMap(context.classes.root)}"><div role="${ifDefined(context.accStartColumnRole)}" class="${classMap(context.classes.columns.start)}" aria-labelledby="${ifDefined(context._id)}-startColumnText"><span id="${ifDefined(context._id)}-startColumnText" class="ui5-hidden-text">${ifDefined(context.accStartColumnText)}</span><slot name="startColumn"></slot></div><div role="${ifDefined(context.accStartArrowContainerRole)}" aria-label=${ifDefined(context.accStartArrowContainerText)} class="ui5-fcl-arrow-container ui5-fcl-arrow-container-start" style="${styleMap(context.styles.arrowsContainer.start)}"><${scopeTag("ui5-button", tags, suffix)} class="ui5-fcl-arrow ui5-fcl-arrow--start" icon="slim-arrow-right" design="Transparent" @click="${context.startArrowClick}" style="${styleMap(context.styles.arrows.start)}" title="${ifDefined(context.accStartArrowText)}"></${scopeTag("ui5-button", tags, suffix)}></div><div role="${ifDefined(context.accMiddleColumnRole)}" class="${classMap(context.classes.columns.middle)}" aria-labelledby="${ifDefined(context._id)}-midColumnText"><span id="${ifDefined(context._id)}-midColumnText" class="ui5-hidden-text">${ifDefined(context.accMiddleColumnText)}</span><slot name="midColumn"></slot></div><div role="${ifDefined(context.accEndArrowContainerRole)}" aria-label="${ifDefined(context.accEndArrowContainerText)}" class="ui5-fcl-arrow-container ui5-fcl-arrow-container-end" style="${styleMap(context.styles.arrowsContainer.end)}"><${scopeTag("ui5-button", tags, suffix)} class="ui5-fcl-arrow ui5-fcl-arrow--end" style="${styleMap(context.styles.arrows.end)}" icon="slim-arrow-left" design="Transparent" @click="${context.endArrowClick}" title="${ifDefined(context.accEndArrowText)}"></${scopeTag("ui5-button", tags, suffix)}></div><div role="${ifDefined(context.accEndColumnRole)}" class="${classMap(context.classes.columns.end)}" aria-labelledby="${ifDefined(context._id)}-endColumnText"><span id="${ifDefined(context._id)}-endColumnText" class="ui5-hidden-text">${ifDefined(context.accEndColumnText)}</span><slot name="endColumn"></slot></div></div> `;


export default block0;
